3\u0437\u0438\u044f<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BE%D1%80%D0%B3%D0%B8%D0%B5%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D1%80%D0%B0%D0%BA%D1%82%D0%B0%D1%82\" title=\"\u0413\u0435\u043e\u0440\u0433\u0438\u0435\u0432\u0441\u043a\u0438\u0439 \u0442\u0440\u0430\u043a\u0442\u0430\u0442\">\u0413\u0435\u043e\u0440\u0433\u0438\u0435\u0432\u0441\u043a\u0438\u0439 \u0442\u0440\u0430\u043a\u0442\u0430\u0442<\/a>, \u0443\u0441\u0442\u0430\u043d\u0430\u0432\u043b\u0438\u0432\u0430\u044e\u0449\u0438\u0439 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u043f\u0440\u043e\u0442\u0435\u043a\u0442\u043e\u0440\u0430\u0442 \u043d\u0430\u0434 \u0412\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0439 \u0413\u0440\u0443\u0437\u0438\u0435\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1789_%D0%B3%D0%BE%D0%B4\" title=\"1789 \u0433\u043e\u0434\">1789<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B5_%D1%81%D0%BE%D0%B1%D1%80%D0%B0%D0%BD%D0%B8%D0%B5_(1789%E2%80%941791)\" class=\"mw-redirect\" title=\"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0435 \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0435 (1789\u20141791)\">\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0435 \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0435<\/a> \u0424\u0440\u0430\u043d\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D1%87%D1%8C_4_%D0%B0%D0%B2%D0%B3%D1%83%D1%81%D1%82%D0%B0_1789_%D0%B3%D0%BE%D0%B4%D0%B0\" title=\"\u041d\u043e\u0447\u044c 4 \u0430\u0432\u0433\u0443\u0441\u0442\u0430 1789 \u0433\u043e\u0434\u0430\">\u043e\u0442\u043c\u0435\u043d\u0438\u043b\u043e<\/a> \u0431\u043e\u043b\u044c\u0448\u0443\u044e \u0447\u0430\u0441\u0442\u044c \u0441\u043e\u0441\u043b\u043e\u0432\u043d\u044b\u0445 \u043f\u0440\u0438\u0432\u0438\u043b\u0435\u0433\u0438\u0439 \u0434\u0443\u0445\u043e\u0432\u0435\u043d\u0441\u0442\u0432\u0430 \u0438 \u0434\u0432\u043e\u0440\u044f\u043d\u0441\u0442\u0432\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1812_%D0%B3%D0%BE%D0%B4\" title=\"1812 \u0433\u043e\u0434\">1812<\/a>&#160;\u2014 \u0441\u043e\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0435 \u043f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BC%D0%BE%D0%BB%D0%B5%D0%BD%D1%81%D0%BA\" title=\"\u0421\u043c\u043e\u043b\u0435\u043d\u0441\u043a\">\u0421\u043c\u043e\u043b\u0435\u043d\u0441\u043a\u043e\u043c<\/a> 1-\u0439 \u0438 2-\u0439 \u0440\u0443\u0441\u0441\u043a\u0438\u0445 \u0430\u0440\u043c\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D1%80%D0%BA%D0%BB%D0%B0%D0%B9-%D0%B4%D0%B5-%D0%A2%D0%BE%D0%BB%D0%BB%D0%B8,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%91%D0%BE%D0%B3%D0%B4%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0411\u0430\u0440\u043a\u043b\u0430\u0439-\u0434\u0435-\u0422\u043e\u043b\u043b\u0438, \u041c\u0438\u0445\u0430\u0438\u043b \u0411\u043e\u0433\u0434\u0430\u043d\u043e\u0432\u0438\u0447\">\u0411\u0430\u0440\u043a\u043b\u0430\u044f-\u0434\u0435-\u0422\u043e\u043b\u043b\u0438<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B3%D1%80%D0%B0%D1%82%D0%B8%D0%BE%D0%BD,_%D0%9F%D1%91%D1%82%D1%80_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0411\u0430\u0433\u0440\u0430\u0442\u0438\u043e\u043d, \u041f\u0451\u0442\u0440 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u0411\u0430\u0433\u0440\u0430\u0442\u0438\u043e\u043d\u0430<\/a>. \u0413\u043b\u0430\u0432\u043d\u043e\u043a\u043e\u043c\u0430\u043d\u0434\u0443\u044e\u0449\u0438\u0439 \u0411\u0430\u0440\u043a\u043b\u0430\u0439-\u0434\u0435-\u0422\u043e\u043b\u043b\u0438 \u0441\u0443\u043c\u0435\u043b \u0434\u043e\u0441\u0442\u0438\u0447\u044c \u0433\u043b\u0430\u0432\u043d\u043e\u0433\u043e: \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0430\u043c \u043d\u0435 \u0443\u0434\u0430\u043b\u043e\u0441\u044c \u043d\u0438 \u0440\u0430\u0437\u044a\u0435\u0434\u0438\u043d\u0438\u0442\u044c \u0440\u0443\u0441\u0441\u043a\u0438\u0435 \u0430\u0440\u043c\u0438\u0438, \u043d\u0438 \u0440\u0430\u0437\u0431\u0438\u0442\u044c \u0438\u0445 \u043f\u043e\u0440\u043e\u0437\u043d\u044c. \u041d\u043e \u0432\u044b\u043d\u0443\u0436\u0434\u0435\u043d\u043d\u043e\u0435 \u043e\u0442\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0435 \u043e\u0442 \u0433\u0440\u0430\u043d\u0438\u0446 \u0432\u044b\u0437\u0432\u0430\u043b\u043e \u043d\u0435\u0434\u043e\u0432\u043e\u043b\u044c\u0441\u0442\u0432\u043e \u0411\u0430\u0440\u043a\u043b\u0430\u0435\u043c \u0438 \u043f\u0440\u0438 \u0434\u0432\u043e\u0440\u0435, \u0438 \u0432 \u0430\u0440\u043c\u0438\u0438, \u0438 \u0432 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1836_%D0%B3%D0%BE%D0%B4\" title=\"1836 \u0433\u043e\u0434\">1836<\/a>&#160;\u2014 \u0432 \u043c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B5%D0%BC%D0%BB%D1%8C\" title=\"\u041a\u0440\u0435\u043c\u043b\u044c\">\u041a\u0440\u0435\u043c\u043b\u0435<\/a> \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B0%D1%80%D1%8C-%D0%BA%D0%BE%D0%BB%D0%BE%D0%BA%D0%BE%D0%BB\" title=\"\u0426\u0430\u0440\u044c-\u043a\u043e\u043b\u043e\u043a\u043e\u043b\">\u0426\u0430\u0440\u044c-\u041a\u043e\u043b\u043e\u043a\u043e\u043b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1879_%D0%B3%D0%BE%D0%B4\" title=\"1879 \u0433\u043e\u0434\">1879<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BB%D1%8C%D0%B7%D0%B0%D1%81\" title=\"\u042d\u043b\u044c\u0437\u0430\u0441\">\u042d\u043b\u044c\u0437\u0430\u0441<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D1%82%D0%B0%D1%80%D0%B8%D0%BD%D0%B3%D0%B8%D1%8F\" title=\"\u041b\u043e\u0442\u0430\u0440\u0438\u043d\u0433\u0438\u044f\">\u041b\u043e