u0438\u043d\u0443\u0442\u044b 13 \u043c\u0438\u043b\u043b\u0438\u043e\u043d\u043e\u0432 \u0442\u0435\u043b\u0435\u0444\u043e\u043d\u043e\u0432 \u043f\u043e \u0432\u0441\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%B0%D1%8F_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u0410\u043c\u0435\u0440\u0438\u043a\u0430\">\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0410\u043c\u0435\u0440\u0438\u043a\u0435<\/a> \u043c\u043e\u043b\u0447\u0430\u043b\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1951_%D0%B3%D0%BE%D0%B4\" title=\"1951 \u0433\u043e\u0434\">1951<\/a>&#160;\u2014 \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BD%D0%BB%D1%8F%D0%BD%D0%B4%D1%81%D0%BA%D0%B8%D0%B9_%D0%B2%D0%BE%D0%BA%D0%B7%D0%B0%D0%BB\" title=\"\u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0441\u043a\u0438\u0439 \u0432\u043e\u043a\u0437\u0430\u043b\">\u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0441\u043a\u043e\u0433\u043e \u0432\u043e\u043a\u0437\u0430\u043b\u0430<\/a> \u043e\u0442\u043f\u0440\u0430\u0432\u0438\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%B5%D0%B7%D0%B4\" title=\"\u042d\u043b\u0435\u043a\u0442\u0440\u043e\u043f\u043e\u0435\u0437\u0434\">\u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043f\u043e\u0435\u0437\u0434<\/a>. \u041a 1980-\u043c \u0432\u043e\u043a\u0437\u0430\u043b \u043f\u043e \u043e\u0431\u044a\u0451\u043c\u0443 \u043f\u0440\u0438\u0433\u043e\u0440\u043e\u0434\u043d\u044b\u0445 \u043f\u0435\u0440\u0435\u0432\u043e\u0437\u043e\u043a \u0432\u044b\u0439\u0434\u0435\u0442 \u043d\u0430 \u0432\u0442\u043e\u0440\u043e\u0435 \u043c\u0435\u0441\u0442\u043e \u0441\u0440\u0435\u0434\u0438 \u0432\u0441\u0435\u0445 \u0432\u043e\u043a\u0437\u0430\u043b\u043e\u0432 \u0421\u0421\u0421\u0420.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1954_%D0%B3%D0%BE%D0%B4\" title=\"1954 \u0433\u043e\u0434\">1954<\/a>&#160;\u2014 \u0441\u0432\u043e\u0439 \u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D0%B5%D1%80%D1%85%D0%B7%D0%B2%D1%83%D0%BA%D0%BE%D0%B2%D0%BE%D0%B9_%D1%81%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82\" title=\"\u0421\u0432\u0435\u0440\u0445\u0437\u0432\u0443\u043a\u043e\u0432\u043e\u0439 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\">\u0441\u0432\u0435\u0440\u0445\u0437\u0432\u0443\u043a\u043e\u0432\u043e\u0439 \u0441\u0430\u043c\u043e\u043b\u0451\u0442<\/a> P-1.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1962_%D0%B3%D0%BE%D0%B4\" title=\"1962 \u0433\u043e\u0434\">1962<\/a>&#160;\u2014 \u041b\u0438\u0434\u0435\u0440 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BD%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BE%D0%BD%D0%B3%D1%80%D0%B5%D1%81%D1%81\" title=\"\u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441\">\u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BD%D0%B4%D0%B5%D0%BB%D0%B0,_%D0%9D%D0%B5%D0%BB%D1%8C%D1%81%D0%BE%D0%BD_%D0%A0%D0%BE%D0%BB%D0%B8%D1%85%D0%BB%D0%B0%D1%85%D0%BB%D0%B0\" class=\"mw-redirect\" title=\"\u041c\u0430\u043d\u0434\u0435\u043b\u0430, \u041d\u0435\u043b\u044c\u0441\u043e\u043d \u0420\u043e\u043b\u0438\u0445\u043b\u0430\u0445\u043b\u0430\">\u041d\u0435\u043b\u044c\u0441\u043e\u043d \u041c\u0430\u043d\u0434\u0435\u043b\u0430<\/a> \u0431\u044b\u043b \u0437\u0430\u043a\u043b\u044e\u0447\u0451\u043d \u0432 \u0442\u044e\u0440\u044c\u043c\u0443, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043f\u0440\u043e\u0432\u0451\u043b 28 \u043b\u0435\u0442. \u0417\u0430 \u044d\u0442\u043e \u0432\u0440\u0435\u043c\u044f \u043e\u043d \u0441\u0442\u0430\u043b \u0441\u0438\u043c\u0432\u043e\u043b\u043e\u043c \u0431\u043e\u0440\u044c\u0431\u044b \u0447\u0435\u0440\u043d\u043e\u043a\u043e\u0436\u0435\u0433\u043e \u043d\u0430\u0441\u0435\u043b\u0435\u043d\u0438\u044f \u042e\u0436\u043d\u043e\u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438 \u043f\u0440\u043e\u0442\u0438\u0432 \u0440\u0430\u0441\u0438\u0441\u0442\u0441\u043a\u043e\u0433\u043e \u0440\u0435\u0436\u0438\u043c\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BF%D0%B0%D1%80%D1%82%D0%B5%D0%B8%D0%B4\" title=\"\u0410\u043f\u0430\u0440\u0442\u0435\u0438\u0434\">\u0430\u043f\u0430\u0440\u0442\u0435\u0438\u0434\u0430<\/a>. \u041f\u043e\u0441\u043b\u0435 \u0432\u044b\u0445\u043e\u0434\u0430 \u043d\u0430 \u0441\u0432\u043e\u0431\u043e\u0434\u0443 \u041c\u0430\u043d\u0434\u0435\u043b\u0430 \u0431\u044b\u043b \u0438\u0437\u0431\u0440\u0430\u043d \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u043e\u043c \u0441\u0442\u0440\u0430\u043d\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1964_%D0%B3%D0%BE%D0%B4\" title=\"1964 \u0433\u043e\u0434\">1964<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D1%86%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D0%B2_%D0%A2%D0%BE%D0%BD%D0%BA%D0%B8%D0%BD%D1%81%D0%BA%D0%BE%D0%BC_%D0%B7%D0%B0%D0%BB%D0%B8%D0%B2%D0%B5\" title=\"\u0418\u043d\u0446\u0438\u0434\u0435\u043d\u0442 \u0432 \u0422\u043e\u043d\u043a\u0438\u043d\u0441\u043a\u043e\u043c \u0437\u0430\u043b\u0438\u0432\u0435\">\u0432\u0442\u043e\u0440\u043e\u0439 \u0422\u043e\u043d\u043a\u0438\u043d\u0441\u043a\u0438\u0439 \u0438\u043d\u0446\u0438\u0434\u0435\u043d\u0442<\/a>. \u0414\u0432\u0430 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0445 \u044d\u0441\u043c\u0438\u043d\u0446\u0430 \u0432 \u0422\u043e\u043d\u043a\u0438\u043d\u0441\u043a\u043e\u043c \u0437\u0430\u043b\u0438\u0432\u0435 \u0441\u043e\u043e\u0431\u0449\u0438\u043b\u0438, \u0447\u0442\u043e \u043f\u043e\u0434\u0432\u0435\u0440\u0433\u043b\u0438\u0441\u044c \u043d\u043e\u0432\u043e\u0439 \u0430\u0442\u0430\u043a\u0435 \u0441\u0435\u0432\u0435\u0440\u043e\u0432\u044c\u0435\u0442\u043d\u0430\u043c\u0441\u043a\u0438\u0445 \u0442\u043e\u0440\u043f\u0435\u0434\u043d\u044b\u0445 \u043a\u0430\u0442\u0435\u0440\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1984_%D0%B3%D0%BE%D0%B4\" title=\"1984 \u0433\u043e\u0434\">1984<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0\" title=\"\u0410\u0444\u0440\u0438\u043a\u0430\">\u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0435<\/a> \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e \u0412\u0435\u0440\u0445\u043d\u044f\u044f \u0412\u043e\u043b\u044c\u0442\u0430 \u0441\u043c\u0435\u043d\u0438\u043b\u043e \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D1%80%D0%BA%D0%B8%D0%BD%D0%B0-%D0%A4%D0%B0%D1%81%D0%BE\" title=\"\u0411\u0443\u0440\u043a\u0438\u043d\u0430-\u0424\u0430\u0441\u043e\">\u0411\u0443\u0440\u043a\u0438\u043d\u0430-\u0424\u0430\u0441\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1988_%D0%B3%D0%BE%D0%B4\" title=\"1988 \u0433\u043e\u0434\">1988<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D0%B3%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1979%E2%80%941989)\" title=\"\u0410\u0444\u0433\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1979\u20141989)\">\u0410\u0444\u0433\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>: \u0437\u0430\u043c\u0435\u0441\u0442\u0438\u0442\u0435\u043b\u044c \u043a\u043e\u043c\u0430\u043d\u0434\u0443\u044e\u0449\u0435\u0433\u043e \u0412\u0412\u0421 40-\u0439 \u0430\u0440\u043c\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%86%D0%BA%D0%BE%D0%B9,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0420\u0443\u0446\u043a\u043e\u0439, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u043e\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0420\u0443\u0446\u043a\u043e\u0439<\/a> (\u0431\u0443\u0434\u0443\u0449\u0438\u0439 \u0432\u0438\u0446\u0435-\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0420\u043e\u0441\u0441\u0438\u0438) \u0441\u0431\u0438\u0442 \u043f\u0430\u043a\u0438\u0441\u0442\u0430\u043d\u0441\u043a\u0438\u043c \u0438\u0441\u0442\u0440\u0435\u0431\u0438\u0442\u0435\u043b\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/General_Dynamics_F-16_Fighting_Falcon\" title=\"General Dynamics F-16 Fighting Falcon\">F-16<\/a>, \u0432\u044b\u043f\u043e\u043b\u043d\u044f\u044f \u0431\u043e\u0435\u0432\u043e\u0439 \u0432\u044b\u043b\u0435\u0442 \u0432 \u0440\u0430\u0439\u043e\u043d\u0435 \u0430\u0444\u0433\u0430\u043d\u043e-\u043f\u0430\u043a\u0438\u0441\u0442\u0430\u043d\u0441\u043a\u043e\u0439 \u0433\u0440\u0430\u043d\u0438\u0446\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1995_%D0%B3%D0%BE%D0%B4\" title=\"1995 \u0433\u043e\u0434\">1995<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F_%C2%AB%D0%91%D1%83%D1%80%D1%8F%C2%BB\" title=\"\u041e\u043f\u0435\u0440\u0430\u0446\u0438\u044f \u00ab\u0411\u0443\u0440\u044f\u00bb\">\u041e\u043f\u0435\u0440\u0430\u0446\u0438\u044f \u00ab\u0